import React, { useState } from "react";
import {
  Menu, Home, ShoppingCart, RotateCw, BarChart2, DollarSign,
  Briefcase, Package, Calendar, AlertTriangle, Info, Users,
  HelpCircle, X, FileText, Truck, FileInput, ClipboardList,
  Wallet, Key, ShieldCheck, Bell
} from "lucide-react";
import { Link } from "react-router-dom";

const menu = [
  { label: "Dashboard", icon: Home, path: "/" },
  { label: "Orders", icon: ShoppingCart, path: "/orders" },
  { label: "Returns", icon: RotateCw, path: "/returns" },
  { label: "Reports", icon: BarChart2, path: "/reports" },
  { label: "Payouts & Account", icon: DollarSign, path: "/payouts" },
  { label: "Services", icon: Briefcase, path: "/services" },
  {
    label: "Items", icon: Package, sub: [
      { name: "All Items", path: "/items/all" },
      { name: "Attributes & Values", path: "/items/attributes" }
    ]
  },
  {
    label: "Planning", icon: Calendar, sub: [
      { name: "Promotions", path: "/planning/promotions" },
      { name: "Calendar", path: "/planning/calendar" }
    ]
  },
  {
    label: "Performance", icon: AlertTriangle, sub: [
      { name: "Order Defect Rate", path: "/performance/defects" },
      { name: "Sales Metrics", path: "/performance/sales" }
    ]
  },
  {
    label: "Business Info", icon: Info, sub: [
      { name: "Basic Info", path: "/business/basic-info" },
      { name: "Shipping Details", path: "/business/shipping-details" },
      { name: "Return Policies", icon: FileInput, path: "/business/returns" },
      { name: "Forms & Agreements", icon: ClipboardList, path: "/business/forms" },
      { name: "Referral Fees", icon: Wallet, path: "/business/referral-fees" }
    ]
  },
  {
    label: "Partner Settings", icon: Users, sub: [
      { name: "Users & Contacts", icon: Users, path: "/settings/users" },
      { name: "Authentications", icon: Key, path: "/settings/auth" },
      { name: "Item Listings Settings", icon: ShieldCheck, path: "/settings/listings" },
      { name: "Notification Settings", icon: Bell, path: "/settings/notifications" }
    ]
  },
  {
    label: "Support", icon: HelpCircle, sub: [
      { name: "Help Center", path: "/support/help-center" },
      { name: "Open Cases", path: "/support/open-cases" }
    ]
  }
];

const Sidebar = () => {
  const [openMenus, setOpenMenus] = useState({});
  const [openMobile, setOpenMobile] = useState(false);

  const toggleMenu = (label) => {
    setOpenMenus((prev) => ({ ...prev, [label]: !prev[label] }));
  };

  const SidebarContent = () => (
    <div className="w-64 bg-gray-900 text-white h-full fixed md:static z-50 overflow-y-auto">
      <div className="flex justify-between items-center p-4 font-bold text-lg bg-gray-800">
        <span>Target +</span>
        <button onClick={() => setOpenMobile(false)} className="md:hidden"><X /></button>
      </div>
      <nav className="space-y-1 text-sm">
        {menu.map((item, idx) => (
          <div key={idx}>
            <div
              className="px-4 py-2 hover:bg-gray-700 cursor-pointer flex justify-between items-center"
              onClick={() => item.sub ? toggleMenu(item.label) : setOpenMobile(false)}
            >
              <Link to={item.path || "#"} className="flex items-center gap-2">
                <item.icon className="w-4 h-4" />
                <span>{item.label}</span>
              </Link>
              {item.sub && <span>{openMenus[item.label] ? "▲" : "▼"}</span>}
            </div>
            {item.sub && openMenus[item.label] && (
              <div className="pl-10 py-1 space-y-1 text-gray-300">
                {item.sub.map((subItem, subIdx) => (
                  <Link key={subIdx} to={subItem.path} className="hover:text-white block">
                    {subItem.icon && <subItem.icon className="inline w-3 h-3 mr-2" />} {subItem.name}
                  </Link>
                ))}
              </div>
            )}
          </div>
        ))}
      </nav>
    </div>
  );

  return (
    <>
      <button className="md:hidden p-2 fixed top-2 left-2 z-50" onClick={() => setOpenMobile(true)}>
        <Menu className="text-black" />
      </button>
      <div className="hidden md:block">
        <SidebarContent />
      </div>
      {openMobile && (
        <div className="md:hidden fixed inset-0 bg-black bg-opacity-50 z-40" onClick={() => setOpenMobile(false)}>
          <SidebarContent />
        </div>
      )}
    </>
  );
};

export default Sidebar;
